Cast:  Careena Collins, Dick Rambone, Jamie Gillis, Kristara Barrington, Lois Ayers, Lynn Francis, Melissa Melendez, Stacey Donovan, Taija Rae


Description:  Erotic legend Alex de Renzy has done it again. The story of a  bachelorette party that turns into a sexual free-for-all. When a group  of gorgeous girls hire a male stripper for their soon-to-be-wed friend,  they wind up with more tham they bargained for - in the form of Jamie  Gillis. Mocked by the girls, mystical Jamie puts a spell on them - and  turns them all into insatiable sex-machines. When their boyfriends try  to rescue the poor gals, the stage is set for an erotic riot...

